import React from 'react'

var clicked = false;

function clickAction() {
    document.getElementById("myCheck").click();
    if (clicked == false) {
        clicked = true
    } else {
        clicked = false
    }
}

const HamburgerButton = () => {
  return (
    <div>
        <div id = 'signout'> 
            <div className = 'hamburger_top'> </div>
            <div className = 'hamburger_middle'> </div>
            <div className = 'hamburger_bottom'> </div>
        </div>
        <div className = {clicked ? 'signout' : ''} id = 'signout'> </div>
    </div>
  )
}

export default HamburgerButton
